function building_style(feature){
					switch (feature.properties.bld_type) {
						case 'Athletic': return {color: "#000000", fillColor: "#4daf4a", fillOpacity: .5};
						case 'Maintenance': return {color: "#000000", fillColor: "#ff7f00", fillOpacity: .5};
						case 'Other': return {color: "#000000", fillColor: "#984ea3", fillOpacity: .5};
						case 'Academic': return {color: "#000000", fillColor: "#e41a1c", fillOpacity: .5};
						case 'Residential': return {color: "#000000", fillColor: "#377eb8", fillOpacity: .5};
						}
					};

var b = L.geoJson(building_layer, {
					style: building_style,
						onEachFeature: function (feature, layer){
							popupOptions = {maxWidth: 250};
							layer.bindPopup(feature.properties.Bld_name + " " + feature.properties.bld_type
							,popupOptions);
							}
						});